INSERT INTO fish_and_places.green_object (is_active, rating, name, price_pro_person, location, created_at, updated_at, contact, latitude, longitude, show_on_first_page, description, type) VALUES (1, 0, 'Река Дунав Видин', '20 лв', 'Видин', '2017-04-10 10:33:31', '2017-04-19 14:22:12', null, 43.9962, 22.8679, 1, '<p>Дунав е дом на много растителни и животински видове. Речното корито е най-голямата заблатена територия в Европа. Тук е най-голямото количество тръстика в целия свят. В делтата на Дунав 1 700 km<sup>2</sup>&nbsp;са обрасли с&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%A2%D1%80%D1%8A%D1%81%D1%82%D0%B8%D0%BA%D0%B0" title="Тръстика">тръстика</a>. Има и няколко вида водна&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BB%D0%B8%D1%8F" title="Лилия">лилия</a>. Опесъчените места са покрити с&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%A2%D1%80%D0%B5%D0%B2%D0%B0" title="Трева">трева</a>&nbsp;&bdquo;Стипа&ldquo;. По поречието на реката се намират гори, където могат да се срещнат множество растения и животни. В гората Литя има дюни с дължина 250 метра и ширина 10 метра. Там някои дървета достигат 10 метра височина.</p>
