INSERT INTO fish_and_places.green_object (is_active, rating, name, price_pro_person, location, created_at, updated_at, contact, latitude, longitude, show_on_first_page, description, type) VALUES (0, null, 'Батак', '30', 'Язовир Батак', '2017-04-09 18:18:04', '2017-04-17 19:15:05', null, 41.9663, 24.1856, 1, null, 1);
INSERT INTO fish_and_places.green_object (is_active, rating, name, price_pro_person, location, created_at, updated_at, contact, latitude, longitude, show_on_first_page, description, type) VALUES (0, null, 'Река Дунав', '20', 'Видин', '2017-04-10 10:33:31', '2017-04-12 20:00:43', null, 43.9962, 22.8679, 1, '<p>Дунав е дом на много растителни и животински видове. Речното корито е най-голямата заблатена територия в Европа. Тук е най-голямото количество тръстика в целия свят. В делтата на Дунав 1 700 km<sup>2</sup>&nbsp;са обрасли с&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%A2%D1%80%D1%8A%D1%81%D1%82%D0%B8%D0%BA%D0%B0" title="Тръстика">тръстика</a>. Има и няколко вида водна&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BB%D0%B8%D1%8F" title="Лилия">лилия</a>. Опесъчените места са покрити с&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%A2%D1%80%D0%B5%D0%B2%D0%B0" title="Трева">трева</a>&nbsp;&bdquo;Стипа&ldquo;. По поречието на реката се намират гори, където могат да се срещнат множество растения и животни. В гората Литя има дюни с дължина 250 метра и ширина 10 метра. Там някои дървета достигат 10 метра височина.</p>
INSERT INTO fish_and_places.green_object (is_active, rating, name, price_pro_person, location, created_at, updated_at, contact, latitude, longitude, show_on_first_page, description, type) VALUES (1, null, 'Беглика', 'билет', 'Язовир Беглика', '2017-04-15 13:51:13', '2017-04-15 13:51:13', null, 41.8059, 24.1172, 1, '<p><strong>Беглика</strong>&nbsp;е малък язовир в&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B4%D0%BE%D0%BF%D0%B8" title="Родопи">Западните Родопи</a>, разположен непосредствено срещу язовир&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%93%D0%BE%D0%BB%D1%8F%D0%BC_%D0%91%D0%B5%D0%B3%D0%BB%D0%B8%D0%BA" title="Голям Беглик">Голям Беглик</a>. Той служи като помощен язовир на Големия Беглик, хващайки водата на река Раково дере и е част от каскадата&nbsp;<a href="https://bg.wikipedia.org/w/index.php?title=%D0%91%D0%B0%D1%82%D0%B0%D0%BA_(%D0%BA%D0%B0%D1%81%D0%BA%D0%B0%D0%B4%D0%B0)&amp;action=edit&amp;redlink=1" title="Батак (каскада) (страницата не съществува)">Батак</a>.</p>', 1);
