<p>Срещат се и много животински видове. Значителен процент от световната популация от птици живее в териториите покрай реката. В делтата на Дунав плуват над 45 вида сладководна риба, от които Acipensednidae е застрашен вид. Известно е, че голям брой от популацията на&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%B8_%D0%BF%D1%8A%D1%81%D1%82%D1%8A%D1%80_%D0%BF%D0%BE%D1%80" title="Европейски пъстър пор">европейския пор</a>&nbsp;живее на&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2" title="Остров">островите</a>&nbsp;по реката. Горите по поречието са дом също на някои редки видове&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%92%D0%BB%D0%B5%D1%87%D1%83%D0%B3%D0%B8" title="Влечуги">влечуги</a>. Единствено в резервата&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%A1%D1%80%D0%B5%D0%B1%D1%8A%D1%80%D0%BD%D0%B0" title="Сребърна">Сребърна</a>&nbsp;гнезди световно застрашеният вид птица &mdash;&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%9A%D1%8A%D0%B4%D1%80%D0%BE%D0%B3%D0%BB%D0%B0%D0%B2_%D0%BF%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D0%BD" title="Къдроглав пеликан">къдроглав пеликан</a>.</p>', 1);

<p>Срещат се и много животински видове. Значителен процент от световната популация от птици живее в териториите покрай реката. В делтата на Дунав плуват над 45 вида сладководна риба, от които Acipensednidae е застрашен вид. Известно е, че голям брой от популацията на&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%B8_%D0%BF%D1%8A%D1%81%D1%82%D1%8A%D1%80_%D0%BF%D0%BE%D1%80" title="Европейски пъстър пор">европейския пор</a>&nbsp;живее на&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2" title="Остров">островите</a>&nbsp;по реката. Горите по поречието са дом също на някои редки видове&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%92%D0%BB%D0%B5%D1%87%D1%83%D0%B3%D0%B8" title="Влечуги">влечуги</a>. Единствено в резервата&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%A1%D1%80%D0%B5%D0%B1%D1%8A%D1%80%D0%BD%D0%B0" title="Сребърна">Сребърна</a>&nbsp;гнезди световно застрашеният вид птица &mdash;&nbsp;<a href="https://bg.wikipedia.org/wiki/%D0%9A%D1%8A%D0%B4%D1%80%D0%BE%D0%B3%D0%BB%D0%B0%D0%B2_%D0%BF%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D0%BD" title="Къдроглав пеликан">къдроглав пеликан</a>.</p>', 1);
